import './donation.css';

const Donation = () => {
    return ( 
        <div id="Donation">
            <div className="header container-fluid">
                <div className="header-content row d-flex align-items-center text-center">
                    <p className="display-1" style={{padding: '20px'}}>Donate</p>
                </div>
            </div>
        </div>
    )
}

export default Donation;
